import React, { useState } from 'react';
import { Resizable } from 'react-resizable';
import Draggable from 'react-draggable';

import './App.css';

const App = () => {
  const [widths, setWidths] = useState([800, 200, 200]);

  const onResize = (index, e, { size }) => {
    const newWidths = [...widths];
    newWidths[index] = size.width;
    setWidths(newWidths);
  };

  return ( 
    <>
  <div className="layout-container">
      <Resizable
        width={widths[0]}
        height={300}
        onResize={(e, { size }) => onResize(0, e, { size })}
        resizeHandles={['e']}
        className="resizable"
      >
        <div className="component">
        <h2>Component 3</h2>
          <p>This is some content for Component 3.</p>
          <img src="https://media.gettyimages.com/id/1335295270/photo/global-connection.jpg?s=612x612&w=gi&k=20&c=xs_DvcvEflA-EIRXXGK71Et6OtVHldTx2E7flyjybk0=" alt="Image 3" />
        </div>
      </Resizable>

      <Resizable
        width={widths[1]}
        height={800}
        onResize={(e, { size }) => onResize(1, e, { size })}
        resizeHandles={['e']}
        className="resizable"
      >
        <div className="component">
        <h2>Component 3</h2>
          <p>This is some content for Component 3.</p>
          <img src="https://media.gettyimages.com/id/1335295270/photo/global-connection.jpg?s=612x612&w=gi&k=20&c=xs_DvcvEflA-EIRXXGK71Et6OtVHldTx2E7flyjybk0=" alt="Image 3" />
        </div>
      </Resizable>

      <Resizable
        width={widths[2]}
        height={300}
        onResize={(e, { size }) => onResize(2, e, { size })}
        resizeHandles={['w']}
        className="resizable"
      >
        <div className="component">
        <h2>Component 3</h2>
          <p>This is some content for Component 3.</p>
          <img src="https://media.gettyimages.com/id/1335295270/photo/global-connection.jpg?s=612x612&w=gi&k=20&c=xs_DvcvEflA-EIRXXGK71Et6OtVHldTx2E7flyjybk0=" alt="Image 3" />
        </div>
      </Resizable>
    </div>

    </>
   );
}

export default App;
